import React from 'react';

function Navbar() {
  return (
    <header>
      <div className="logo" >
        {/* <img src="https://bookinn-sc77.onrender.com/assets/Frame.png" alt="Bookinn Logo" /> */}
        <h1>ABA FAMOUS MAWULENU KWAKU</h1>
      </div>
      <nav>
        <a href="#hero" className="active">Home</a>
        <a href="#about">About</a>
        <a href="#contact">Contact Us</a>
      </nav>
    </header>
  );
}

export default Navbar;
